・うす型で片寄らず、からだにぴったりフィット、スタイルをくずしません。<br />・防寒、からだの保温、冷えの予防、屋外でのスポーツ観戦・レジャーに最適です。<br /><br /><br />【成分】<br />鉄粉・水・活性炭・バーミキュライト・塩類・木粉・吸水性樹脂　<br /><br />【内容量】<br />30枚<br /><br />【使用上の注意】<br /><br />！ご使用前に必ずお読みください低温やけど防止のために必ずお守りください！<br /><br />・低温やけどとは、体温より高い温度の発熱体を長時間あてていると起こるやけどのこと。気がつかないうちに起きる場合があるので、ときどき肌の状態を確認し、強い赤み・かゆみ・痛みなどの症状が現れた場合はすぐに使用を中止すること。症状が治まらない場合や水ぶくれなどになった場合は医師に相談すること。<br /><br />・お子さま、身体の不自由な方、皮膚の弱い方、初めて使う方は特に注意して使用すること。<br /><br />・就寝時は使用しないこと。寝てしまうと熱さを感じにくく、低温やけどの恐れあり。また寝具の中では高温になる恐れあり。<br />・肌に直接貼らないこと。<br /><br />・肌に直接ふれないようにすること。<br />・下着など薄い衣類で使用する場合は注意すること。<br />・長時間同じ所へ使用しないこと。<br /><br />・熱いと感じたときは使用を中止すること。<br />・こたつやストーブなど他の暖房器具との併用、至近での使用はしないこと。急激な発熱、ふくらみ、破れなどの恐れあり。<br /><br />・カイロを押さえつけるなど、血行を妨げる使い方はしないこと。<br /><br />・糖尿病などで血行障害のある方は熱さを感じにくい場合があり、低温やけどの恐れあり。使用に際しては医師に相談すること。<br /><br />・体調のすぐれない方は熱さを感じにくい場合あり。低温やけどに十分注意すること。<br /><br />JANコード：4987072039731<br /><br />商品番号：101-52356<br /><br />（　カイロ・あったか・防寒・寒さ対策　）<br /><br />。<br /><br /><br /><br /><br /><br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
